import React from 'react'
import Landnav from '../landpage/landnav';
import "./successstory.css";
import Successcard1 from './successcard';
import Successcard2 from './successcard2';
import Successcard3 from './successcard2';

function Success() {
  return (
    <div className='successentire'>
    <div className='successnav'>
        <Landnav/>
    </div>
    <div className='successback'>
          <div className='successrow1'>
            <Successcard1/>
          </div>
          <div className='successcardrow2'>
            <Successcard2/>
          </div>
          <diiv className='successcardrow3'>
            <Successcard3/>
          </diiv>
    </div>
    </div>
  )
}

export default Success;
